          "distinct": true,
          "id": "52494464139461f07cccd3d15d1b3da93b58ef50",
          "message": "Support Array enumerator (#560)\n\n* Fix AddByteOffset IL\r\n\r\n* Add IsWellKnownType and IsString to TypeSystem\r\n\r\n* Create Common folder for EEType and associated constants and use in ILCompiler\r\n\r\n* Remove size from AllocObj nodes and get base size from EETypePtr instead.\r\nNote NewString/NewArray still call into original code passing size though.\r\n\r\n* Add ComponentSize to EEType\r\nMake ConstructedEEType compute the basesize\r\nRevert accidental change to StoreElemImporter\r\n\r\n* Support cast from UShort to Ptr\r\n\r\n* Use shared EEType class instead of having it solely in S.P.Corlib\r\n\r\n* Add helper classes to access object and array raw data\r\nAdd method to get reference to 0th element of array.\r\nExpose internal assembly routine for allocating object based on EEType pointer\r\nAdd method to box a value type\r\n\r\n* Method on object to get raw data, and EEType pointer\r\n\r\n* Make Array implement IList - but note only enumeration and GetValue currently implemented\r\n\r\n* Add proper Equals implementation to Char for comparing boxed chars\r\n\r\n* Add tests for Array enumeration and GetValue\r\n\r\n* Add extra overrides for intrinsics\r\n\r\n* Fix SQ issues",
