          "id": "47897dc0f6362b47e3a6b9bd3dde2c0e0f1fc86d",
          "message": "Handle arrays in interface dispatch (#577)\n\n* Allow Equ's to symbols rather than addresses\r\n\r\n* Emit Equ for SYSTEMARRAY mapping to the constructed type symbol for System.Array or 0 if it is not required.\r\n\r\n* Extend interface dispatch to handle arrays properly. If the type being dispatched on is an SzArray then if no result is found searching in the types interface dispatch map then use System.Array as it's base type to repeat the search.\r\n\r\n* For ArrayTypes Category maps to SzArray or Array type flag depending on the rank\r\n\r\n* Handle arrays properly in GetClosestDefType, if the array type supports generic interfaces then use Array<T> as the closest Def type instead of Array.\r\n\r\n* Change RuntTimeInterfaces to handle arrays properly.\r\n\r\n* Add algorithm to computer runtime interfaces for Array<T>\r\nMinor improvements and changes to support Arrays properly\r\n\r\n* Implement generic array enumerator\r\n\r\n* Implement Enumerable.ToList<T>\r\n\r\n* Add simple test for Enumerable.ToList<T>\r\n\r\n* Move to v4 of upload-artifact in workflows\r\n\r\n* Add definitions for IEnumerable.Count<T> and Any<T>\r\n\r\n* Fix SQ Issues\r\n\r\n* Remove unnecessary block",
