          "message": "Add Array methods (#598)\n\n* Remvoe ParamsCount from CodeGeneratorContext\n\n* Refactor Constructed EE type dependencies in preparation for handling multi-dimensional arrays\n\n* Add this parameter as method signatures no longer include this parameter.\n\n* Add this explicitly as parameter in local variable table as method.Signature no longer includes this\n\n* Containing Types\n\n* Handle nested types properly when formatting type names\n\n* Add GetMethod and GetMethodWithEquivalentSignature to Managed Type System type hierarchy\n\n* Move SignatureType creation into TypeSystemContext\nAdd MemberResolution to DnlibModule that uses GetMethod to resolve methods\n\n* Expose IsExplicitThis\n\n* Refactor MethodSignature to use flags\nRefactor Equals/Equivalence\nSupport instantiaton of signature\n\n* Extend ArrayType to support ArrayMethods properly\n\n* Fix bug with parameter count when return buffers involved\n\n* Fix SQ issues\n\n* Make parameter names consistent\n\n* Fix SQ issue\n\n* Fix SQ issue",
